import React from 'react';
import styled from 'styled-components';

type jumboProps = {
    content: string;
}

const Content = styled.section`
    font-size: 42px;
    text-align: left;
`;

const Jumbo: React.FC<jumboProps> = (props) => {
    return <Content>{props.content}</Content>
};

Jumbo.defaultProps = {
    content: 'This is the Blockquote content'
};

export default Jumbo;
